import React from 'react';
import {Button, View} from 'react-native';

const ContactScreen = ({navigation}) => {
    return (
        <View>
            <Button onPress={() => navigation.navigate("Fun")}>About</Button>
        </View>
    );
};

export default ContactScreen;
